import Header from '../components/header/header'
import Footer from '../components/footer/footer'
import Head from 'next/head'

export function MainLayout({ children, title = 'ООО Уралэлектроремонт' }) {
  return (
      <>
        <Head>

        </Head>
        <Header/>
        <main>
          {children}
        </main>
        <Footer/>
      </>
  )
}
